import jsonData from '../data/data.json';
import "../styles/Diplomas.css"; 
import DiplomaList from './DiplomaList';

function Diplomas() {
    return (
    <div className='diplomas'>
        <h3>{jsonData.francais.titreFormation}</h3>
        <DiplomaList />
    </div>
    );
}

export default Diplomas;
